import React from 'react';

class Search extends React.Component{

    render(){
        return(
            <div>
                <input type="text" placeholder="search" id="input-id"/>
                <input className={this.val()}type= "button" value="submit"/>
            </div>


        );
    }
    val(){
        let v = document.getElementById('input-id');
        return v.value == "no" ? {color : "red"} : {color : "blue"}
    }
}
export default Search;
